// UserTile.js
import React from 'react';
import './pages.css';
//import './UserTile.css'; // Optional: for custom styling

const UserTile = ({ user }) => {
  return (
    <div className="user-tile">
      <div className="user-tile__header">
        <h4>{user.name}</h4>
      </div>
      <div className="user-tile__body">
        <p>{user.email}</p>
        <p>Status: {user.status}</p>
      </div>
    </div>
  );
};

export default UserTile;
